import React from 'react';
import { useNavigate, NavLink } from 'react-router-dom';
import { AUTH_ROUTE } from '../../const';
import { REG_ROUTE } from '../../const';
import "./Buttons.css";

const AuthButton = () => {

    const navigate = useNavigate();

    const handleButtonClick = () => {
    navigate(AUTH_ROUTE);
    };
    const handleButtonClick1 = () => {
    navigate(REG_ROUTE);
    };
    const leave = () => {
        localStorage.removeItem("token");
        user.setIsAuth(false);
        navigate("/auth");
        console.log(2);
      };

    return (
        <div>
            <div className='buttons'>
                <div className='auth_button'>
                    <button onClick={handleButtonClick} className='authbutton'>Вход</button>
                </div>
                <div className='reg_button'>
                    <button onClick={handleButtonClick1} className='regbutton'>Регистрация</button>
                </div>
            </div>
            <NavLink className="navig" onClick={leave} to={AUTH_ROUTE}>
            Выйти
            </NavLink>
            
        </div>
    );
};

export default AuthButton;
